import React from 'react';
import "./Question.css";
export default function Question(props) {

    function question() {
        <p>questionText:</p>
    }

    return (
        <div onClick={question} class="boxes">
            <p>pointValue: {props.point}</p>
            <p>answer: {props.answer}</p>
        </div>
    );

  }
